import React from 'react';
import { Wrapper, Header, H1, HorizontalScrollPage, Flexbox, SmallContainer} from '../components'

import TimelineContainer from './TimelineContainer.js'
import TimelineItem from './TimelineItem.js'

class Overview extends React.Component {
	constructor( props ) {
		super(props); 
		this.state = {

		}
	}

	onSearchChange = (event) => {

	}

	render() {
		return(
		    <Wrapper>
			    <Header>
			    	<H1 big>MCU TIMELINE</H1>		    	
			    </Header>

			    <SmallContainer width='100px' backgroundcolor='red'>

			    </SmallContainer>

			   	<TimelineContainer>
			   		<TimelineItem title='Iron Man' date='05/03/2008' phase='1' color='red'/>
